/**
 * @description basically console.time with a return
 */
class Timer {
  constructor() {
    this.timers = {};
  }

  time(name) {
    if (this.timers[`${name}`]) {
      console.warn(`timer allready declared for variable ${name}, returning`);
      return null
    }
    const startTime = performance.now();
    this.timers[`${name}`] = { startTime };
    return startTime
  }

  timeEnd(name) {
    if (!this.timers[`${name}`]) {
      console.warn(`No timer defined with name ${name} to end, returning`);
      return null
    }
    const endTime = performance.now();
    const { startTime } = this.timers[`${name}`];
    return { elapsedTime: endTime - startTime, endTime }
  }
}

