async function handleAxiosResponse(response) {
  const { status } = response;
  const body = response.data;
  let error;
  switch (status) {
    case 200:
      return body.data ? body.data : body // some apis apparently use body.data whereas others just body
    case 201:
      return body.data ? body.data : body
    case 301:
      // @see https://github.com/axios/axios#response-schema
      // The `request` property here is the request that generated this response
      if (window.$nuxt) {
        const { $nuxt } = window;
        await $nuxt.$router.push(response.request.res.responseUrl);
      }
      return null
    case 302:
      // @see https://github.com/axios/axios#response-schema
      // The `request` property here is the request that generated this response
      if (window.$nuxt) {
        const { $nuxt } = window;
        await $nuxt.$router.push(response.request.res.responseUrl);
      }
      return null
    case 304:
      return body.data ? body.data : body
    case 400:
      throw new Error(body.message)
    case 401:
      throw new Error(body.message)
    case 403:
      throw new Error(body.message)
    case 404:
      throw new Error(body.message)
    default:
      error = new Error();
      error.status = response.status;
      error.message = body.message;
      throw error
  }
}

