function getEventConfig(url,roomName) {
  return fetch(`${url}/v2/events/?roomName=${roomName}`,{
    method: 'GET'
  })
    .then(res => res.json())
    .then(response => response.data)
}

async function getStreamConfig(url,eventId,authPayload) {
  const axiosRequest = axios.create({
    withCredentials: !!authPayload
  });
  const response = await axiosRequest({
    headers:{
      // we don't need authorization header on a v1 api
      Authorization: authPayload ? `Bearer ${authPayload}` : undefined,
      'Content-Type': 'application/json'
    },
    method:'GET',
    baseURL:`${url}`,
    url:`/v2/events/${eventId}/streams`
  }).then(handleAxiosResponse);
  return response
}

