function login(url, username, password) {
  const loginData = JSON.stringify({ email:username, password });
  return fetch(`${url}/v2/users/me/login`,{
    method: 'POST',
    body:loginData,
    headers: {
      'Content-Type': 'application/json'
      // 'Content-Type': 'application/x-www-form-urlencoded',
    },
  })
    .then(res => res.json())
    .then(response => response.data)
}


async function returnGeoDomains(isDevMode) {
  try {
    const isChina = await isLocationChina();
    if (isChina) {
      const urls = {
        apiUrl:`https://${isDevMode ? 'devapi' : 'api'}.akkadu.cn`,
        assetsUrl:'https://akkaducloud-production.s3.cn-north-1.amazonaws.com.cn'
      };
      return urls
    }
    const urls = {
      apiUrl:`https://${isDevMode ? 'devapi' : 'api'}.akkadu.com`,
      assetsUrl:'https://assets.akkadu.com'
    };
    return urls
  }
  catch (err) {
    console.warn('Error in api detection function, defaulting to China', err);
    const urls = {
      apiUrl:`https://${isDevMode ? 'devapi' : 'api'}.akkadu.cn`,
      assetsUrl:'https://akkaducloud-production.s3.cn-north-1.amazonaws.com.cn'
    };
    return urls
  } 
}



function isLocationChina() {
  return fetch('https://api.ipgeolocation.io/ipgeo?apiKey=049fb81c8f6841fbbf5a3f438c7eb967')
    .then(res => res.json())
    .then((data) => {
      if (String(data.country_tld).match(/cn/i)) {
        return true
      }
      return false
    })
}

